import React from 'react';
import './About.css';

function Projects() {
  return (
    <section id="projects" className="projects">
      <h2>Projects</h2>
      <div className="project-list">
        <div className="project-item">
          <h3>Project 1</h3>
          <p>Description of the project.</p>
        </div>
        <div className="project-item">
          <h3>Project 2</h3>
          <p>Description of the project.</p>
        </div>
      </div>
    </section>
  );
}

export default Projects;
